import { Banner } from './Banner';

export default class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userName: "Adam",
            todoItems: [{ action: "Buy Flowers", done: false },
            { action: "Get Shoes", done: false },
            { action: "Collect Tickets", done: true },
            { action: "Call Joe", done: false }],
            showCompleted: true
        }
    }

    render() {
        return (
            <>
               <Banner/> 
            </>
            
            )
    }

        
    
}
